import "./TeamMemberCard.css";

const TeamMemberCard = ({ name, role, profile }) => {
  return (
    <div className="team-member-card-wrapper">
      <img src={profile}></img>
      <h2>{name}</h2>
      <h3>{role}</h3>
    </div>
  );
};

export default TeamMemberCard;
